import PropTypes from "prop-types";

function Meme(props) {
const { meme } = props;

  meme.map((url, topText, bottomText) => {
    return (
      <section class="section is-medium pt-0 pb-6 has-text-centered" >
        <article class="message is-medium" >
          <div class="message-body" id="output">
            <div class="meme">
              <img id="img" src={url} width="800rem" height="auto"/>
              <h2 id="top-text" class="top">{topText}</h2>
              <h2 id="bottom-text" class="bottom">{bottomText}</h2>
            </div>
          </div>
        </article>
      </section>
    );
  })
}

export default Meme;

Meme.propTypes = {
  meme: PropTypes.object.isRequired
};
